          of the server (me, MrFloris) decided to be nice to his team of staff for
          once and said, \"Let''s eat pizza together.\""]}'
        - '{"text":"","extra":["Of course, we''re not going to exclude our players,
          so here we are, inviting you to join us to just hang out on friday evening
          for some fun. \n\nCheck out \"/pizza\" on the Dutch evening of the 26th
          of April, and you will find us running around being goofy from ......."]}'
        - '{"text":"","extra":["eating all the pizza we can ! Together, as a group
          .. because, it''s fun. \n\nYou can explore, maybe you find some SIGNS (hint
          hint hint)\n\nMaybe you learn it says to msg something to some staff, and
          maybe hey have a pizza cutter to poke"]}'
        - '{"text":"","extra":["You with, and you end up with some goodies?\n\nI said
          too much!\n\nIf you can''t make it, that''s okay; you at least have this
          pizza kit, so go enjoy making that pizza oven I talked about and cook up
          that extra vote reward item (deepslate emerald)."]}'
        - '{"text":"","extra":["And then eat it, EAT IT, eat the pizza, we like pizza,
          yummy pizza.\n\nQuestions? Oof, yeah, I dunno, ask - maybe we have the answer,
          but, I don''t know, I might just be too busy eating pizza.\n\nIt will be
          a crazy, silly, goofy hour of fun.\nJoin us? :D Hang out?"]}'
        - '{"text":"","extra":["AND YES, spoiler, we will actually be eating pizza
          offline IRL. Feel free to get a slice yourself and let us know.\n\nPictures
          are very welcome in #minecraft and #food channels on our /discord.\n\n",{"text":"discord.gg/floris","clickEvent":{"action":"open_url","value":"http://discord.gg/floris"}}]}'
        - '{"text":"","extra":["PIZZA PIZZA PIZZA PIZZA PIZZA PIZZA PIZZA PIZZA PIZZA
