        title: Beyond Book
        author: mrfloris
        pages:
        - '{"text":"","extra":["\n\n\n 🌸 🌸 🌸\n\nBeyond the \n   Blossom Trees\n\n
          🌸 🌸 🌸"]}'
        - '{"text":"","extra":["\nA collection of 8 books, including this one, which
          tells the story of a Minecraft player, capturing the essence of learning
          the game, experiencing adventure, and settling in on the ",{"text":"1MoreBlock.com","clickEvent":{"action":"open_url","value":"http://1MoreBlock.com"}},"
          server."]}'
        - '{"text":"","extra":["\nCollect all 6 chapters, the epilogue, and this book
          to share in the spirit of exploration, adventure, and the joy of playing
          Minecraft."]}'
        - '{"text":"","extra":["The First Breath\n\nBook 1: Her awakening into the
          world, and the beginning of her journey on the ",{"text":"1MoreBlock.com","clickEvent":{"action":"open_url","value":"http://1MoreBlock.com"}},"
          survival server.\n\n(first chapter)"]}'
        - '{"text":"","extra":["Discoveries in the Wilderness\n\nBook 2: Her exploration
          of the wild, gathering resources, and learning the basics of crafting."]}'
        - '{"text":"","extra":["A Place to Call Home\n\nBook 3: Finding the perfect
          spot to build her first shelter and make a safe haven among the cherry blossoms."]}'
        - '{"text":"","extra":["Mysteries in the Air\n\nBook 4: Noticing strange particles
          and learning about the existence of other dimensions like the Nether and
          the End."]}'
        - '{"text":"","extra":["The Ruined Portal\n\nBook 5: Restoring the broken
          portal, stepping into the Nether, and discovering its secrets.\n\n"]}'
        - '{"text":"","extra":["The Stronghold and the End\n\nBook 6: The journey
          to the ancient city, finding the stronghold, and stepping into the End dimension.\n\n\n(last
          chapter)"]}'
        - '{"text":"","extra":["1MoreBlock\n\nBook 7: Returning home, reflecting on
          her adventures, and the ongoing quest for more exploration, crafting, and
          building.\n\n(epilogue)"]}'
        - '{"text":"","extra":["Go build a little library, or visit a friend who has
          one. \n\nSo you have a place to store this collection. \n\nEach book is
          a chapter, and there''s this book, and the epilogue. But that''s not all
          ...."]}'
        - '{"text":"","extra":["... Maybe !! Just maybe you are a creative person,
          a writer, a dreamer, a Minecrafter ... And maybe you''re inspired to continue
          this story. \n\nFeel free to write something and share it with mrfloris
          on 1MoreBlock.com\n(would be pretty cool)"]}'
