        title: Beyond Ch.1
        author: mrfloris
        pages:
        - '{"text":"","extra":["\n\n 🌸 🌸 🌸\n\nChapter 1: \n\nThe First Breath\n\n
          🌸 🌸 🌸"]}'
        - '{"text":"","extra":["Psst, before you start to read this book, make sure
          you''ve completed the collection! \n\n"]}'
        - '{"text":"","extra":["    She opened her eyes for the very first time, the
          world materializing around her in vivid color and sound. \n\nThe air was
          fresh, the sun was bright, and in front of her was a simple wooden sign
          that read: \"Welcome to the ",{"text":"1MoreBlock.com","clickEvent":{"action":"open_url","value":"http://1MoreBlock.com"}},"
          Survival Server.\" "]}'
        - '{"text":"","extra":["She blinked, taking in the words, her mind brimming
          with curiosity and anticipation. \n\nWhat was this place? Who had built
          it? \n\nAnd, most importantly, what was she supposed to do?"]}'
        - '{"text":"","extra":["Looking around, she noticed a well-worn hiking path
          leading away from the sign, its direction pointing towards a dense wilderness.\n\nWithout
          hesitation, she stepped forward, her feet carrying her into the unknown."]}'
        - '{"text":"","extra":["The path wound through tall grass and past towering
          oak trees, each step revealing more of this vast, untamed world. \n\nShe
          marveled at the sight of wildflowers in every hue imaginable, the chorus
          of birds above her head, and the rustle of leaves in the gentle breeze."]}'
